/**************Get Properties******************/

// Get Project level property
def projectProp = testRunner.testCase.testSuite.project.getPropertyValue("CountryName")
log.info ("Project Property = "+projectProp)

// Get Test Suite level property
def testSuiteProp = testRunner.testCase.testSuite.getPropertyValue("CountryName")
log.info ("TestSuite Property = "+testSuiteProp)

// Get Test Suite level property
def testCaseProp = testRunner.testCase.getPropertyValue("CountryName")
log.info ("TestSuite Property = "+testCaseProp)

// Get Test Suite level property
def testStepProp = testRunner.testCase.getTestStepByName("Properties").getPropertyValue("Name")
log.info ("TestSuite Property = "+testStepProp)

// loop through property
testRunner.testCase.properties.each
{
	key,value ->
	log.info (testRunner.testCase.getPropertyValue(key))
	log.info (key+" - "+ value)
}
